import twilio from "twilio";

export default function sendSMS() {
  const accountSid = "ACb08cd3ce904220fb3385cbee58b3fe57";
  const authToken = "deccf88a2f482e25d4a16897d456095b";
  const client = twilio(accountSid, authToken);

  client.messages
    .create({
      to: "+61498582854",
      from: "+18706003769",
      body: "Hello Myeonghoon",
    })
    .then((message) => console.log(message.sid));
}
